import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();
  const isActive = (path) => location.pathname === path;

  return (
    <nav className="navbar">
      <div className="navbar-inner">
        <div className="navbar-brand">
          <Link to="/" onClick={() => setIsOpen(false)}>
            <span className="brand-mark">DSP</span>
            <span className="brand-text">Data Science Platform</span>
          </Link>
        </div>

        <button
          className={`navbar-toggle ${isOpen ? 'active' : ''}`}
          aria-label="Toggle navigation"
          aria-expanded={isOpen}
          onClick={() => setIsOpen((v) => !v)}
        >
          <span />
          <span />
          <span />
        </button>

        <ul className={`navbar-menu ${isOpen ? 'open' : ''}`}>
          <li><Link className={isActive('/home') ? 'active' : ''} to="/home" onClick={() => setIsOpen(false)}>Home</Link></li>
          <li><Link className={isActive('/roadmap') ? 'active' : ''} to="/roadmap" onClick={() => setIsOpen(false)}>Roadmap</Link></li>
          <li><Link className={isActive('/dashboard') ? 'active' : ''} to="/dashboard" onClick={() => setIsOpen(false)}>Dashboard</Link></li>
          <li><Link className={isActive('/signin') ? 'active' : ''} to="/signin" onClick={() => setIsOpen(false)}>Sign In</Link></li>
          <li><Link className="btn-nav" to="/signup" onClick={() => setIsOpen(false)}>Get Started</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
